import React, { createContext, useContext, useEffect, useState } from 'react';

// Create the AuthContext
const AuthContext = createContext();

// AuthProvider component
export const AuthProvider = ({ children }) => {
    const [user, setUser] = useState(null); // Holds user state
    const [error, setError] = useState(null); // Holds error state
    const [loginSuccess, setLoginSuccess] = useState(false); // Holds login success state
    const [events, setEvents] = useState([]); // Holds the events state
    const [members, setMembers] = useState([]); // Holds the registered members state

    // Check if there is saved login info on component mount
    useEffect(() => {
        const savedUser = JSON.parse(localStorage.getItem("user"));
        if (savedUser) {
            setUser(savedUser);
            setLoginSuccess(true);
        }
    }, []);

    // Login function
    const login = (username, password, rememberMe) => {
        return new Promise((resolve, reject) => {
            // Example login logic; you might want to replace this with actual authentication logic
            if (username === 'admin' && password === 'admin') {
                const loggedInUser = { name: 'Admin', role: 'admin' };
                setUser(loggedInUser);
                setError(null); // Clear any previous errors
                setLoginSuccess(true); // Set login success

                // Save login info if "Remember Me" is checked
                if (rememberMe) {
                    localStorage.setItem("user", JSON.stringify(loggedInUser)); // Save user info
                } else {
                    sessionStorage.setItem("user", JSON.stringify(loggedInUser)); // Save user info in sessionStorage
                }

                resolve(); // Login successful
            } else {
                setError('Invalid username or password'); // Set error message
                reject(new Error('Invalid credentials')); // Reject the promise
            }
        });
    };

    // Logout function
    const logout = () => {
        setUser(null);
        setError(null); // Clear error on logout
        setLoginSuccess(false); // Reset login success on logout
        localStorage.removeItem("user"); // Remove saved login info from localStorage
        sessionStorage.removeItem("user"); // Remove saved login info from sessionStorage
    };

    // Function to add events
    const addEvent = (event) => {
        setEvents((prevEvents) => [...prevEvents, event]); // Add event to the events array
    };

    // Function to remove events
    const removeEvent = (eventToRemove) => {
        setEvents((prevEvents) => prevEvents.filter(event => event !== eventToRemove)); // Remove event from the events array
    };

    // Function to add members
    const addMember = (member) => {
        setMembers((prevMembers) => [...prevMembers, member]); // Add member to the members array
    };

    // Function to fetch events (optional, depending on your needs)
    const fetchEvents = () => {
        // Fetch events from an API or database
        // Example: fetch('/api/events').then(response => response.json()).then(data => setEvents(data));
    };

    // Provide the context value
    return (
        <AuthContext.Provider value={{ user, login, logout, error, loginSuccess, events, addEvent, removeEvent, fetchEvents, members, addMember }}>
            {children}
        </AuthContext.Provider>
    );
};

// Custom hook to use the AuthContext
export const useAuth = () => {
    const context = useContext(AuthContext);
    if (!context) {
        throw new Error('useAuth must be used within an AuthProvider');
    }
    return context;
};

// Sample Login Form Component
const LoginForm = () => {
    const { login, error } = useAuth();
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [rememberMe, setRememberMe] = useState(false);

    const handleSubmit = (e) => {
        e.preventDefault();
        login(username, password, rememberMe)
            .then(() => {
                // Handle successful login (redirect, etc.)
            })
            .catch((err) => {
                console.error(err);
            });
    };

    return (
        <form onSubmit={handleSubmit} className="login-form">
            <div className="input-container">
                <input
                    type="text"
                    placeholder="Username"
                    value={username}
                    onChange={(e) => setUsername(e.target.value)}
                    className="login-input"
                />
                <input
                    type="password"
                    placeholder="Password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    className="login-input"
                />
                {error && <p className="error-message">{error}</p>}
            </div>
            <label>
                <input
                    type="checkbox"
                    checked={rememberMe}
                    onChange={(e) => setRememberMe(e.target.checked)}
                /> Remember Me
            </label>
            <button type="submit">Login</button>
        </form>
    );
};

export default LoginForm;
